import React, { useState } from "react";

import "./style.css";

const Singleproduct = ({ addToCart, shopItems }) => {
  const [mainImage, setMainImage] = useState("../images/shops/shop-1.png");
  const [quantity, setQuantity] = useState(1);
  const thumbnails = [
    "../images/shops/shop-1.png",
    "../images/shops/shop-1.png",
    "../images/shops/shop-1.png",
  ];

  return (
    <>
      <div className=" product-container ">
        <div className="product-image-section">
          {/* Image Section */}
          <div className="w-full lg:w-2/3 flex flex-col lg:flex-row gap-6">
            {/* Thumbnails */}
            <div className="product-thumbnails ">
              {thumbnails.map((img, index) => (
                <img
                  key={index}
                  src={img}
                  alt="Thumbnail"
                  className={`w-16 h-16 object-cover cursor-pointer border-2 rounded ${
                    mainImage === img ? "border-red-500" : "border-gray-200"
                  }`}
                  onClick={() => setMainImage(img)}
                />
              ))}
            </div>
            
            {/* Main Image */}
            <div 
              className="flex-1 order-1 lg:order-2 bg-gray-100 rounded-lg overflow-hidden"
              style={{ 
                backgroundImage: `url(${mainImage})`, 
                height: "500px",
                backgroundSize: "contain",
                backgroundRepeat: "no-repeat",
                backgroundPosition: "center"
              }}
            ></div>
          </div>

          {/* Product Info Section */}
          <div className="w-full lg:w-1/3 flex flex-col gap-6">
            <h2 className="text-3xl font-bold text-gray-800">Pocket Cotton Sweatshirt</h2>
            <p className="text-gray-600 text-lg">
              Nam tempus turpis at metus scelerisque placerat nulla deumantos solicitud felis...
            </p>
            
            <div className="flex items-center gap-2 text-red-500 font-bold text-lg">
              <span>FREE DELIVERY</span>
            </div>
            
            <div className="flex items-center gap-3">
              <span className="text-gray-400 line-through text-lg">$629.99</span>
              <span className="text-2xl font-bold text-gray-800">$495.00</span>
            </div>
            
            {/* Star Rating */}
            <div className="flex gap-1 text-yellow-400 text-xl">
              {[...Array(4)].map((_, i) => (
                <i key={i} className="fas fa-star"></i>
              ))}
              <i className="fas fa-star-half-alt"></i>
            </div>
            
            {/* Color Selection */}
            <div className="mt-2">
              <span className="font-bold text-gray-800">Select Color:</span>
              <div className="flex gap-3 mt-3">
                {["#e54e5d", "#252525", "#60b3f3"].map((color, index) => (
                  <div 
                    key={index} 
                    className="w-8 h-8 rounded-full cursor-pointer border-2 border-transparent hover:border-gray-300 transition-all"
                    style={{ backgroundColor: color }}
                  ></div>
                ))}
              </div>
            </div>
            
            {/* Quantity & Cart */}
            <div className="flex items-center gap-4 mt-4">
              <span className="font-medium text-gray-800">Quantity:</span>
              <div className="flex items-center border border-gray-300 rounded px-3 py-1">
                <button 
                  className="px-2 text-lg font-medium text-gray-600 hover:text-gray-900"
                  onClick={() => setQuantity(Math.max(1, quantity - 1))}
                >
                  -
                </button>
                <span className="mx-3 text-lg font-medium">{quantity}</span>
                <button 
                  className="px-2 text-lg font-medium text-gray-600 hover:text-gray-900"
                  onClick={() => setQuantity(quantity + 1)}
                >
                  +
                </button>
              </div>
            </div>
            
            <button 
              className="add-to-cart-button"
              onClick={() => addToCart()}
            >
              ADD TO CART
            </button>
          </div>
        </div>
      </div>
    </>
  );
};

export default Singleproduct;
